import React from 'react';
import {StyleSheet, View} from 'react-native';

const Card = props => {
    return (
        <View style={{...styles.card, ...props.style}}>
            {/* display all the value passed from parent */}
            {props.children}
        </View>
    );
}

const styles = StyleSheet.create({
    card: {
        shadowColor: 'black',
        shadowOpacity: 0.26,
        shadowOffset: {width: 0, height: 2},
        shadowRadius: 8,
        elevation: 8,
        borderRadius: 10,
        backgroundColor: 'white',
    }
})

export default Card;
